import React from 'react';
import { Link, NavLink } from 'react-router-dom';


function Nav() {

    const navStyle = {
        color: '#ffffff',
        textDecoration: 'none'
    };

    return (
        <>
            <Nav>
                <NavLink to="/">
                    <h1>Logo</h1>
                </NavLink>
                <Bars />
                <NavMenu>
                    <NavLink to="/" activeStyle>
                        Home
                    </NavLink>
                    <NavLink to="/" activeStyle>
                        About
                    </NavLink>
                </NavMenu>
                <NavBtn>
                    <NavBtnLink to="/signin">
                        Sign Up
                    </NavBtnLink>
                </NavBtn>
            </Nav>
        </>
    )
}

export default Nav;
